import React from 'react';

const AssetInfoCards = () => {
  return (
    <div
      className="flex w-[699px] h-[43px] items-start gap-[16px] flex-shrink-0"
    >
      <div
        className="total-assets flex p-[16px] justify-center items-center gap-[16px] self-stretch rounded-[8px] bg-[#FFF]"
        style={{ width: 'auto' }}
      >
        {/* Total Assets Content */}
      </div>
      
      <div
        className="stock-prize flex w-[151px] h-[43px] p-[16px_0px_0px_0px] gap-[16px] flex-shrink-0 self-stretch rounded-[8px_0px_0px_0px] bg-[#FFF] opacity-0"
      >
        <div className="flex flex-col items-center">
          <div
            className="w-[69px] h-[16px] gap-[0px] opacity-0"
            style={{
              fontFamily: 'Roboto',
              fontSize: '14px',
              fontWeight: 400,
              lineHeight: '16.41px',
              textAlign: 'center',
              background: '#FFFFFF',
            }}
          >
            Stock prize
          </div>
          <div
            className="w-[99px] h-[23px] gap-[0px] opacity-0"
            style={{
              fontFamily: 'Roboto',
              fontSize: '20px',
              fontWeight: 600,
              lineHeight: '23.44px',
              textAlign: 'left',
              background: '#343B3F',
            }}
          >
            â‚± 38,631.8
          </div>
        </div>
      </div>

      <div
        className="expenses flex w-[151px] p-[16px] justify-center items-center gap-[16px] flex-shrink-0 self-stretch rounded-[8px] bg-[#FFF]"
      >
        {/* Expenses Content */}
      </div>

      <div
        className="assets-for-borrowing flex w-[178px] p-[16px] justify-center items-center gap-[16px] flex-shrink-0 self-stretch rounded-[8px] bg-[#FFF]"
      >
        {/* Assets for Borrowing Content */}
      </div>
    </div>
  );
};

export default AssetInfoCards;
